const Footer = () => {
    return (
        <div>
            <div className="brands">
                <img src="https://res.cloudinary.com/robcg1102/image/upload/v1604355701/maq_img/truper_zhsgth.png" alt="Truper" style={{height: "30px"}}/>
                <img src="https://res.cloudinary.com/robcg1102/image/upload/v1604355701/maq_img/phillips_gjenwo.png" alt="Phillips"/>
                <img src="https://res.cloudinary.com/robcg1102/image/upload/v1604355700/maq_img/coflex_lo9jxk.png" alt="Coflex"/>
                <img src="https://res.cloudinary.com/robcg1102/image/upload/v1604355701/maq_img/teka_apzohv.png" alt="Teka"/>
                <img src="https://res.cloudinary.com/robcg1102/image/upload/v1604355701/maq_img/steren_qa8ei0.png" alt="Steren" style={{height: "35px"}}/>
            </div>
            <div></div>
            <div></div>
        </div>
    )
}

export default Footer;
